import React, { useState, createContext } from 'react';
import { Routes, Route } from 'react-router-dom';
import { Box } from '@mui/material';
import Navbar from './components/Navbar';
import HomePage from './pages/HomePage';
import LoginPage from './pages/LoginPage';
import RegisterPage from './pages/RegisterPage';
import DashboardPage from './pages/DashboardPage';
import TaskListPage from './pages/TaskListPage';
import TaskCreatePage from './pages/TaskCreatePage';
import ProfilePage from './pages/ProfilePage';
import ChatPage from './pages/ChatPage';
import LabourHirePage from './pages/LabourHirePage';
import MiddlemenPage from './pages/MiddlemenPage';
import TractorHirePage from './pages/TractorHirePage';
import AnnouncementsPage from './pages/AnnouncementsPage';
import {
  Typography,
  Button
} from '@mui/material';
// Language context for translation
export const LanguageContext = createContext({
  language: 'en',
  setLanguage: (lang: string) => {},
});

function App() {
  const [language, setLanguage] = useState('en');

  return (
    <LanguageContext.Provider value={{ language, setLanguage }}>
      <Box sx={{ display: 'flex', flexDirection: 'column', minHeight: '100vh' }}>
        {/* Translator Bar */}
          <Box sx={{ width: '100%', background: 'rgba(255,255,255,0.85)', py: 1, px: 2, display: 'flex', justifyContent: 'flex-end', alignItems: 'center', boxShadow: 1, position: 'sticky', top: 0, zIndex: 10 }}>
        <Typography sx={{ mr: 2, fontWeight: 'bold', color: '#388e3c' }}>Translate:</Typography>
        <Button size="small" sx={{ mx: 0.5 }} variant="outlined">తెలుగు</Button>
        <Button size="small" sx={{ mx: 0.5 }} variant="outlined">ಕನ್ನಡ</Button>
        <Button size="small" sx={{ mx: 0.5 }} variant="outlined">English</Button>
        <Button size="small" sx={{ mx: 0.5 }} variant="outlined">हिन्दी</Button>
      </Box>
        <Box sx={{ width: '100%', background: 'rgba(255,255,255,0.95)', py: 1, px: 2, display: 'flex', justifyContent: 'flex-end', alignItems: 'center', boxShadow: 1, position: 'sticky', top: 0, zIndex: 100 }}>
          <span style={{ fontWeight: 'bold', color: '#388e3c', marginRight: 12 }}>Translate:</span>
          <button style={{ margin: '0 4px', padding: '4px 12px', borderRadius: 6, border: '1px solid #388e3c', background: language === 'te' ? '#c8e6c9' : '#fff', color: '#388e3c', cursor: 'pointer' }} onClick={() => setLanguage('te')}>తెలుగు</button>
          <button style={{ margin: '0 4px', padding: '4px 12px', borderRadius: 6, border: '1px solid #388e3c', background: language === 'kn' ? '#c8e6c9' : '#fff', color: '#388e3c', cursor: 'pointer' }} onClick={() => setLanguage('kn')}>ಕನ್ನಡ</button>
          <button style={{ margin: '0 4px', padding: '4px 12px', borderRadius: 6, border: '1px solid #388e3c', background: language === 'en' ? '#c8e6c9' : '#fff', color: '#388e3c', cursor: 'pointer' }} onClick={() => setLanguage('en')}>English</button>
          <button style={{ margin: '0 4px', padding: '4px 12px', borderRadius: 6, border: '1px solid #388e3c', background: language === 'hi' ? '#c8e6c9' : '#fff', color: '#388e3c', cursor: 'pointer' }} onClick={() => setLanguage('hi')}>हिन्दी</button>
        </Box>
        <Navbar />
         <Box sx={{ width: '100%', background: 'rgba(255,255,255,0.85)', py: 1, px: 2, display: 'flex', justifyContent: 'flex-end', alignItems: 'center', boxShadow: 1, position: 'sticky', top: 0, zIndex: 10 }}>
        <Typography sx={{ mr: 2, fontWeight: 'bold', color: '#388e3c' }}>Translate:</Typography>
        <Button size="small" sx={{ mx: 0.5 }} variant="outlined">తెలుగు</Button>
        <Button size="small" sx={{ mx: 0.5 }} variant="outlined">ಕನ್ನಡ</Button>
        <Button size="small" sx={{ mx: 0.5 }} variant="outlined">English</Button>
        <Button size="small" sx={{ mx: 0.5 }} variant="outlined">हिन्दी</Button>
      </Box>
        <Box component="main" sx={{ flexGrow: 1, pt: 8 }}>
          <Routes>
            <Route path="/" element={<HomePage />} />
            <Route path="/login" element={<LoginPage />} />
            <Route path="/register" element={<RegisterPage />} />
            <Route path="/dashboard" element={<DashboardPage />} />
            <Route path="/tasks" element={<TaskListPage />} />
            <Route path="/tasks/create" element={<TaskCreatePage />} />
            <Route path="/labour" element={<LabourHirePage />} />
            <Route path="/middlemen" element={<MiddlemenPage />} />
            <Route path="/tractors" element={<TractorHirePage />} />
            <Route path="/announcements" element={<AnnouncementsPage />} />
            <Route path="/profile" element={<ProfilePage />} />
            <Route path="/chat" element={<ChatPage />} />
          </Routes>
        </Box>
      </Box>
    </LanguageContext.Provider>
  );
}

export default App;
